# @param {Integer[]} a
# @param {Integer[]} b
# @return {Integer}
def min_domino_rotations(a, b)
  a_rotations = [get_rotations(a, b, a[0]), get_rotations(a, b, b[0])].compact.min
  b_rotations = [get_rotations(b, a, b[0]), get_rotations(b, a, a[0])].compact.min

  min = -1
  min = a_rotations if a_rotations
  min = b_rotations if b_rotations && (min == - 1 || min > b_rotations)
  min
end

def get_rotations(a, b, prev)
  rotations = prev == a[0] ? 0 : 1
  idx = 1
  while idx < a.length
    if a[idx] == prev
      idx += 1
    elsif b[idx] == prev
      rotations += 1
      idx += 1
    else
      return nil
    end
  end
  rotations
end


